import React, {Component} from 'react';
import '././bootstrap/bootstrap.css';
class NameForm extends React.Component {
  // ;
  state = {value:null, count:null}
  constructor(props) {
    super(props);
    
    this.setState((props)=>{
      return {value: props
      }
    })

    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
    
  }
    handleChange(event) {
      this.setState({value: event.target.value});
    }

    handleSubmit(event) {
      alert('Welcome: ' + this.state.value);
      event.preventDefault();
    }


  render() {
    return (
      
      
        <div className="row">
        <form className="form-inline">
          <div className="form-group mb-2" onSubmit={this.handleSubmit}>
            <label for="staticEmail2" className="sr-only">Email</label>
            <h4>Type your name or a NickName:</h4>
            <input type="text" readonly class="form-control-plaintext" id="staticEmail2" value={this.state.value} onChange={this.handleChange}></input>
          </div>
          <div class="form-group mx-sm-3 mb-2">
            <label for="inputPassword2" className="sr-only">Password</label>
            <input type="password" className="form-control" id="inputPassword2" placeholder="Password"></input>
          </div>
          <button type="submit" className="btn btn-primary mb-2">Confirm identity</button>
        </form>

        <div className="col">
        <p ><h4>Welcome</h4><h5> {this.state.value?this.state.value:'( ͡° ͜ʖ ͡°)'}</h5></p>
        <br></br>
        </div>
      </div>
      
      

    );

  }
}

  export default NameForm;
